using namespace std;

#define LOG 20
#define maxn int(5e5+10)

vector<int> show;
int pref[maxn];
int vis[maxn], lvl[maxn], id_dad[maxn];
vector<pair<int, int>> adj[maxn];
int dad[maxn][LOG];
vector<vector<int>> comp;

void dfs(int u, int p, int h, int c){
    comp[c].emplace_back(u);
    vis[u] = 1;
    lvl[u] = h;
    dad[u][0] = p;
    for(int i = 1; i < LOG; i++)
        if(dad[u][i-1] != -1)
            dad[u][i] = dad[dad[u][i-1]][i-1];
    for(auto [v, id]:adj[u]){
        if(!vis[v]){
            id_dad[v] = id;
            dfs(v, u, h+1, c);
        }
    }
}

int LCA(int u, int v){
    if(lvl[u] > lvl[v]) swap(u, v);
    for(int i = LOG-1; i >= 0; i--)
        if(dad[v][i] != -1 && lvl[u] < lvl[dad[v][i]])
            v = dad[v][i];
    if(u == dad[v][0]) return u;
    v = dad[v][0];
    for(int i = LOG-1; i >= 0; i--)
        if(dad[u][i] != dad[v][i])
            u = dad[u][i], v = dad[v][i];
    return u;
}

void dfs2(int u){
    vis[u] = 1;
    for(auto [v, id]:adj[u]){
        if(!vis[v]){
            dfs2(v);
            pref[u] += pref[v];
        }
    }
    if((pref[u]&1) != 0 && dad[u][0] != -1)
        show.emplace_back(id_dad[u]);
}

int main(){
    int n, m;
    cin >> n >> m;
    for(int i = 0, u, v; i < n; i++){
        cin >> u >> v;
        adj[u].emplace_back(v, i);
        adj[v].emplace_back(u, i);
    }
    int c = 0;
    memset(dad, -1, sizeof(dad));
    for(int i = 1; i <= m; i++){
        if(!vis[i]){
            comp.push_back({});
            dfs(i, -1, 1, c++);
        }
    }

    vector<int> v(m);
    for(int &x:v) cin >> x;

    for(int i = 0; i < c; i++){
        int sum = 0;
        for(int u:comp[i])
            sum += v[u-1];
        if(sum&1){
            cout << "-1\n";
            return 0;
        }
        for(int j = 0; j < comp[i].size(); j += 2){
            int u = comp[i][j], w = comp[i][j+1];

            int lca = LCA(u, w);

            pref[u]++;
            pref[w]++;
            pref[lca]--;
            if(dad[lca][0] != -1)
                pref[dad[lca][0]]--;
        }
    }

    memset(vis, 0, sizeof(vis));

    for(int i = 0; i < c; i++){
        dfs2(comp[i][0]);
    }

    cout << show.size() << "\n";
    for(int id:show) cout << id+1 << " "; cout << "\n";

    return 0;
}

